import React from 'react'
import Header from './Header'
import Note from './Note'
import Footer from './Footer'
import Notes from '../Notes'

function display(data)
  {
    return <Note 
    title={data.title}
    content={data.content}
    />
  }

function App() {

  return (
    <div>
        <Header/>
        {Notes.map(display)}
        <Footer/>
    </div>
  )
}

export default App;
